import React from 'react'
import {PRODUCTS} from '../../products'

const shop = () => {
  return (
    <div className="shop">
      <div className='shopTitle'>
        <h1>ECommerce Shop</h1>
      </div>
      <div className='products'>
        {PRODUCTS.map(product=><Product/>)}
      </div>
    </div>
  )
}

export default shop
